indexer = {
	id: 'opengl',
	name: 'OpenGL',
	icon: 'data:image/svg+xml;base64,',
	copyright: 'OpenGL and the oval logo are trademarks or registered trademarks of Silicon Graphics, Inc. in the United States and/or other countries worldwide.',

	index : function (ctx) {
		return ctx.fetchDocument('https://www.opengl.org/sdk/docs/man/html/indexflat.php', { srcdoc : true }).then(function (document) {
			var links = document.querySelectorAll('ul.Level3 a[href]');
			for (var i = 0, it; (it = links[i]); i++) {
				ctx.pushIndex(it.textContent, it.href);
			}
		});
	}
};



